'use strict';
!(function (e) {
  e(document).ready(function () {
    e('.event .zmdi-eye, .event .zmdi-eye-off').on('click', function () {
      e(this).hasClass('zmdi-eye')
        ? (e(this).removeClass('zmdi-eye'),
          e(this).addClass('zmdi-eye-off'),
          e(this).parents('tr').addClass('current'),
          e(this).parents('tr').next('.subLine').addClass('flex'))
        : e(this).hasClass('zmdi-eye-off') &&
          (e(this).removeClass('zmdi-eye-off'),
          e(this).addClass('zmdi-eye'),
          e(this).parents('tr').removeClass('current'),
          e(this).parents('tr').next('.subLine').removeClass('flex'));
    }),
      e('.subMenu').on('click', function () {
        e(this).toggleClass('openMenu'), e('.header').toggleClass('pdb60');
      }),
      e('.main-table tr').on('click', function () {}),
      e('.inputCheck').on('click', function () {
        e(this).parents('tr').addClass('current');
      }),
      e('.main-btn.icon').on('click', function () {
        e('.wrapperNewBox').addClass('open'), e('.overley').addClass('open');
      }),
      e('.wrapperNewBox .zmdi-close').on('click', function () {
        e('.wrapperNewBox').removeClass('open'),
          e('.overley').removeClass('open');
      });
  });
})(jQuery);
